class Solution:
    def countPalindromicSubsequence(self, s: str) -> int:

        #for each letter in the alphabet, find the first and last instance
        #then every unique letter in between
        #O(n)
        total = 0
        length=len(s)

        for letter in set(s):
            for i in range(length):
                if s[i] == letter:
                    first = i
                    break
            for i in range(length-1,-1,-1):
                if s[i] == letter:
                    last = i
                    break
            total += len(set(s[first+1:last]))
        return total
    
